define('text!aurelia-editables/resources/elements/data-grid-toolbar.html', ['module'], function(module) { module.exports = "<template>\n\n    <div class=\"table-toolbar\" if.bind=\"showToolbar\">\n        <div class=\"pull-left\">\n            <button if.bind=\"options.editing === true && formMode === true\" class=\"btn btn-primary\" click.delegate=\"endEditForm($event)\" title=\"${'Back' | t}\">\n                <i class=\"fa fa-caret-left\"></i> <span class=\"hidden-xs\"> ${'Back' | t}</span>\n            </button>\n\n            <button if.bind=\"options.filtering === true && formMode !== true\" class=\"btn btn-default\" click.delegate=\"toggleFilter($event)\">\n                <i class=\"fa fa-filter\"></i>\n            </button>\n\n            <button if.bind=\"options.editing === true\" class=\"btn btn-default\" click.delegate=\"add($event)\" title=\"${'Add' | t}\">\n                <i class=\"fa fa-plus\"></i> <span class=\"hidden-xs\"> ${'Add' | t}</span>\n            </button>\n\n            <button if.bind=\"options.editing === true && editMode === false && formMode == false\"\n                    class=\"btn btn-default\"\n                    click.delegate=\"edit($event)\"\n                    title=\"${'Edit' | t}\">\n\n                <i class=\"fa fa-pencil-square\"></i> <span class=\"hidden-xs\"> ${'Edit' | t}</span>\n\n            </button>\n\n            <button if.bind=\"options.editing === true && editMode === true && formMode == false\"\n                    class=\"btn btn-primary\"\n                    click.delegate=\"edit($event)\"\n                    title=\"${'Finish Edit' | t}\">\n\n                <i class=\"fa fa-pencil-square-o\"></i> <span class=\"hidden-xs\"> ${'Finish Edit' | t}</span>\n\n            </button>\n\n            <button if.bind=\"options.editing === true\" disabled.bind=\"recordManager.isValid !== true\" class=\"btn btn-success\" click.trigger=\"save($event)\" title=\"${'Save' | t}\">\n                <i class=\"fa fa-floppy-o\"></i> <span class=\"hidden-xs\"> ${'Save' | t}</span>\n            </button>\n\n            <button if.bind=\"options.editing === true\" class=\"btn btn-warning\" click.delegate=\"cancel($event)\" title=\"${'Cancel' | t}\">\n                <i class=\"fa fa-ban\"></i> <span class=\"hidden-xs\"> ${'Cancel' | t}</span>\n            </button>\n\n            <button class=\"btn btn-default\" click.delegate=\"refresh($event)\" title=\"${'Refresh' | t}\">\n                <i class=\"fa fa-refresh\"></i>\n            </button>\n        </div>\n\n        <span class=\"clearfix\"></span>\n    </div>\n\n</template>\n"; });
define('text!aurelia-editables/resources/elements/data-grid.html', ['module'], function(module) { module.exports = "<template ref=\"dataGrid\">\n\n    <!-- Child Grids -->\n    <div if.bind=\"childMode\">\n        <div class=\"animated fadeIn panel panel-primary\">\n            <div class=\"panel-body\">\n\n                <!-- Nav tabs -->\n                <ul class=\"nav nav-tabs\" role=\"tablist\">\n                    <li>\n                        <a href=\"#\" click.delegate=\"hideChildren($event)\" title=\"${'Back' | t}\">\n                            <i class=\"fa fa-caret-left\"></i> ${'Back' | t} -\n                            <span repeat.for=\"fieldName of options.children[0].childOptions.titleFieldNames\">\n                                ${recordManager.currentRecord[fieldName]}${!$last ? ',' : ''}\n                            </span>\n                        </a>\n                    </li>\n                    <li role=\"presentation\" class=\"${$first ? 'active' : ''}\" repeat.for=\"child of options.children\">\n                        <a href=\"#${child.name}\" aria-controls=\"${child.name}\" role=\"tab\" data-toggle=\"tab\">${child.title | t}</a>\n                    </li>\n                </ul>\n\n                <!-- Tab panes -->\n                <div class=\"tab-content\">\n                    <div role=\"tabpanel\" class=\"tab-pane ${$first ? 'active' : ''}\" id=\"${child.name}\" repeat.for=\"child of options.children\">\n\n                        <data-grid parent-record.bind=\"recordManager.currentRecord\"\n                                   options.bind=\"child\"\n                                   can-load.bind=\"childMode\"></data-grid>\n\n                    </div>\n                </div>\n\n            </div>\n        </div>\n\n    </div>\n    <!-- /Child Grids -->\n\n    <!-- Current Grid -->\n    <div show.bind=\"!childMode\" class=\"data-grid animated fadeIn\">\n        <!-- Toolbar -->\n        <compose view-model=\"${toolbarTemplateOption}\" model.bind=\"gridModel\"></compose>\n        <!-- /Toolbar -->\n\n        <!-- Edit Form -->\n        <div show.bind=\"formMode\">\n            <div class=\"panel-body\">\n                <data-form show-toolbar.bind=\"false\"\n                           integrated-mode.bind=\"true\"\n                           edit-mode.bind=\"formMode\"\n                           record.two-way=\"recordManager.currentRecord\"\n                           options.bind=\"options\" />\n            </div>\n        </div>\n        <!-- /Edit Form -->\n\n        <!-- Data area -->\n        <div ref=\"tableContainer\" show.bind=\"!formMode\">\n            <div show.bind=\"loading\" ref=\"loader\" class=\"data-grid-loader\">\n                <div class=\"spinner\" style=\"margin: 0 auto;\">\n                    <div style=\"background-color: #222\" class=\"bounce1\"></div>\n                    <div style=\"background-color: #222\" class=\"bounce2\"></div>\n                    <div style=\"background-color: #222\" class=\"bounce3\"></div>\n                </div>\n            </div>\n\n            <div ref=\"tableHeaderScroll\" class=\"data-grid-header\">\n                <table ref=\"tableHeader\" class=\"table table-striped\">\n                <thead show.bind=\"showHeader\">\n                    <tr>\n                        <th class=\"row-actions\" if.bind=\"options.editing === true || options.children.length > 0\">\n                            <div style=\"min-width: 100px;\">&nbsp;</div>\n                        </th>\n                        <th id=\"th-${column.name}\"\n                            show.bind=\"column.hide !== true\"\n                            interact-resizable.bind=\"resizableOptions\"\n                            interact-resizemove.delegate=\"resizeColumn($event, column)\"\n                            repeat.for=\"column of options.columns\">\n\n                            <div class=\"${column.type+'-content'} column-header\"\n                                 click.delegate=\"sort(column.name)\"\n                                 css=\"width: ${column.width ? (column.width-8)+'px' : 143+'px'}\">\n\n                                <span>${column.title ? column.title : column.name | t}</span>\n                                <i if.bind=\"sortSettings.field === column.name\" class=\"pull-right data-grid-sorter fa ${sortSettings.dir === 'asc' ? 'fa-sort-asc' : 'fa-sort-desc'}\"></i>\n                                <i if.bind=\"sortSettings.field !== column.name\" class=\"text-light-grey data-grid-sorter pull-right fa fa-sort\"></i>\n                                <span class=\"clearfix\"></span>\n\n                            </div>\n                        </th>\n                    </tr>\n                    <tr if.bind=\"options.filtering === true && filterVisible === true\" class=\"filter-row\">\n                        <th if.bind=\"options.editing === true\" style=\"border-right: none;\"></th>\n                        <th show.bind=\"column.hide !== true\" repeat.for=\"column of options.columns\">\n                            <div css=\"width: ${column.width ? (column.width)+'px' : 150+'px'}\">\n                                <div if.bind=\"column.filter !== false\">\n                                    <input class=\"form-control filter-input\"\n                                           value.bind=\"columnFilters[column.name]\"\n                                           keyup.delegate=\"setFilter(column.name) & debounce:300\"\n                                           placeholder=\"${'Filter...' | t}\" />\n                                </div>\n                            </div>\n                        </th>\n                    </tr>\n                </thead>\n            </table>\n            </div>\n\n            <div ref=\"tableBodyScroll\"\n                 class=\"data-grid-body\"\n                 css=\"height: ${options.height ? options.height+'px' : '400px'}\"\n                 scroll.trigger=\"onScroll($event)\">\n\n                <table ref=\"tableBody\" class=\"table table-striped\">\n                    <tbody>\n                    <tr class.bind=\"item === recordManager.currentRecord ? 'active' : ''\"\n                        show.bind=\"item.state != 'deleted'\"\n                        virtual-repeat.for=\"item of recordManager.records\"\n                        click.delegate=\"select(item)\">\n\n                        <td if.bind=\"options.editing === true || options.children.length > 0\">\n                            <div style=\"min-width: 100px;\">\n                                <button if.bind=\"options.children.length > 0\" class=\"btn btn-sm btn-default\"\n                                        click.delegate=\"showChildren(item, $event)\">\n                                    <i class=\"fa fa-table\"></i>\n                                </button>\n\n                                <button if.bind=\"options.editing === true\" class=\"btn btn-sm btn-default\"\n                                        click.delegate=\"editForm(item, $event)\">\n                                    <i class=\"fa fa-pencil\"></i>\n                                </button>\n\n                                <button if.bind=\"options.editing === true\" class=\"btn btn-sm btn-danger\"\n                                        click.delegate=\"remove(item, $event)\">\n                                    <i class=\"fa fa-remove\"></i>\n                                </button>\n                            </div>\n\n                        </td>\n                        <td class=\"td-${column.name}\"\n                            show.bind=\"column.hide !== true\"\n                            repeat.for=\"column of options.columns\">\n\n                            <div css=\"width: ${column.width ? column.width+'px' : 150+'px'}\" class=\"td-content\">\n                                <field options.bind=\"column\"\n                                       integrated-mode.bind=\"true\"\n                                       edit-mode.bind=\"item.editMode\"\n                                       field-value.bind=\"item[column.name]\"\n                                       record.bind=\"item\"\n                                       with-label.bind=\"false\" />\n                            </div>\n                        </td>\n                    </tr>\n                </tbody>\n                </table>\n\n            </div>\n        </div>\n        <!-- /Data area -->\n\n        <!-- Footer, pager -->\n        <div if.bind=\"showPager === true\" class=\"table-footer\" show.bind=\"!formMode\">\n            <pager class=\"pull-left\"\n                   if.bind=\"options.paging !== false\"\n                   ref=\"pager\"\n                   count.bind=\"total\"\n                   size.bind=\"pageSettings.size\">\n            </pager>\n\n            <span class=\"clearfix\"></span>\n        </div>\n        <!-- /Footer, pager -->\n\n    </div>\n    <!-- /Current Grid -->\n\n</template>\n"; });
define('text!aurelia-editables/resources/elements/field.html', ['module'], function(module) { module.exports = "<template>\n\n    <span if.bind=\"!editMode\" class=\"field-content ${editorType}-content\"><compose model.bind=\"fieldModel\" view.bind=\"viewStrategy\"></compose></span>\n\n    <div if.bind=\"editMode\" class=\"${editableClass} ${editorType}-editor ${!isValid ? 'field-error' : ''}\">\n        <label if.bind=\"withLabel === true\">${options.title ? options.title : options.name | t}</label>\n\n        <compose view-model=\"${editorViewModel}\" model.bind=\"fieldModel\"></compose>\n\n        <div if.bind=\"isValid !== true\" class=\"animated fadeInDown\">\n            <ul class=\"error-list\">\n                <li repeat.for=\"errorInfo of errors\">\n                    ${errorInfo.message}\n                </li>\n            </ul>\n        </div>\n\n    </div>\n</template>\n"; });
define('text!aurelia-editables/resources/elements/multi-grid.html', ['module'], function(module) { module.exports = "<template>\r\n\r\n    <div class=\"panel panel-primary\">\r\n        <div class=\"panel-body\">\r\n\r\n            <!-- Nav tabs -->\r\n            <ul class=\"nav nav-tabs\" role=\"tablist\">\r\n                <li role=\"presentation\" class=\"${$first ? 'active' : ''}\" repeat.for=\"options of gridOptions\">\r\n                    <a href=\"#${options.name}\" aria-controls=\"${options.name}\" role=\"tab\" data-toggle=\"tab\">\r\n                        <i if.bind=\"options.titleIcon\" class.bind=\"options.titleIcon\"></i> ${options.title | t}\r\n                    </a>\r\n                </li>\r\n            </ul>\r\n\r\n            <!-- Tab panes -->\r\n            <div class=\"tab-content\">\r\n                <div role=\"tabpanel\" class=\"tab-pane ${$first ? 'active' : ''}\" id=\"${options.name}\"  repeat.for=\"options of gridOptions\">\r\n                    <data-grid if.bind=\"options !== null\" options.bind=\"options\"></data-grid>\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n    </div>\r\n</template>"; });
define('text!aurelia-editables/resources/elements/pager.html', ['module'], function(module) { module.exports = "\n<template>\n    <ul class=\"pagination\" style=\"margin: 0\">\n        <li if.bind=\"total > 1\" class.bind=\"current === 1 ? 'disabled' : ''\">\n            <a href=\"#\" aria-label=\"${'Previous' | t}\" click.delegate=\"prev()\">\n                <span aria-hidden=\"true\">&laquo;</span>\n            </a>\n        </li>\n\n        <li if.bind=\"total > 1\" repeat.for=\"page of total\" class.bind=\"page === current-1 ? 'active' : ''\">\n            <a href=\"#\" click.delegate=\"setPage(page+1)\">${page+1}</a>\n        </li>\n\n        <li if.bind=\"total > 1\" class.bind=\"current === total ? 'disabled' : ''\">\n            <a href=\"#\" aria-label=\"${'Next' | t}\" click.delegate=\"next()\">\n                <span aria-hidden=\"true\">&raquo;</span>\n            </a>\n        </li>\n        <li>\n            <a>\n                <span if.bind=\"count > 0\">${currentPageInfo} of</span>\n                ${count} records\n            </a>\n        </li>\n    </ul>    \n</template>\n"; });
